import React from 'react'

import RoundedButton from '../global/buttons/RoundedButton'

import AboutUs from './AboutUs'
import LogIn from './LogIn'
import Services from './Services'
import Menu from './Menu'

import './css/Nav.scss'

const Nav = (props) => {
    return (
        <>
            <nav>
                <ul>
                    <RoundedButton
                        button_CLASSNAME={'transparent_ROUNDEDBUTTON'}
                        button_ID={'languages_header_BUTTON'}
                        span_CLASSNAME={'p-medium'}
                        button_TEXT={'EN'}
                        Arrow002={true}
                    />
                    <AboutUs />
                    <LogIn />
                    <RoundedButton
                        button_CLASSNAME={'blue_ROUNDEDBUTTON'}
                        button_ID={'services_header_BUTTON p-medium'}
                        span_CLASSNAME={'p-medium'}
                        button_TEXT={'Services'}
                        Arrow002={false}
                    />
                    <Services />
                    <Menu />
                </ul>
            </nav>
        </>
    )
}

export default Nav
